INSERT INTO `soal_cpof` (`id`, `soal`, `ja`, `jb`, `jc`, `jd`, `jk`) VALUES
(1,	'Sektor perekonomian dibagi menjadi 3 kelompok besar yaitu : primer, sekunder dan tertier ,  Perusahaan provider internet sebagai penyedia layanan internet termasuk dalam sektor mana ?',	'Primer',	'Sekunder',	'Tertier',	'Gabungan sekunder dan tersier',	'c'),
(2,	'Jenis Budaya organisasi yang cocok untuk perusahaan yang baru berdiri adalah :',	'Budaya Peran',	'Budaya Kekuasaan',	'Budaya Tugas',	'Budaya Mandiri',	'b'),
(3,	'Dalam melakukan proses pengadaan barang dan jasa selain memperhatikan Pedoman Pengadaan Barang dan Jasa Pemerintah/Perusahaan, juga harus memperhatikan peraturan-peraturan yang lain yang terkait, dengan tujuan :',	'Agar supaya kegiatan pengadaan lebih efisien',	'Agar tidak dapat sanggah dari peserta lain',	'Agar supaya dalam melakukan kegiatan pengadaan barang/jasa tidak melanggar peraturan yang lain.',	'Agar supaya kegiatan pengadaan lebih terorganisir',	'c'),
(4,	'Apakah dampak paling buruk yang timbulkan apabila Pengadaan barang dan jasa tidak dikelola dengan baik dan benar ?',	'Tidak tercapainya visi dan misi organisasi',	'Terjadinya pemborosan anggaran',	'Terjadinya permasalahan hukum yang berkaitan dengan pengadaan',	'Jawaban a, b dan c salah',	'a'),
(6,	'Spend Analysis dilakukan terhadap :',	'Data belanja Organisasi tidak sejenis',	'Data belanja Penyedia',	'Data dari Badan Pusat Statistik',	'Data belanja barang dan jasa Organisasi tahun-tahun sebelumnya.',	'd'),
(7,	'Hasil spend Analysis digunakan untuk keperluan :',	'Menentukan Penyedia yang akan diikutkan dalam proses pengadaan.',	'Penentu arah Organisasi di Bidang Pengadaan',	'Penyusunan anggaran dan paket pengadaan',	'Untuk meningkatkan efisiensi proses pengadaan',	'c'),
(8,	'Setelah kebutuhan barang dan jasa diketahui, langkah pertama yang perlu dilakukan guna menyusun rencana pemenuhan kebutuhan Organisasi adalah:',	'Mempersiapkan strategi kontrak.',	'Menyusun prioritas kebutuhan.',	'Mempertimbangkan pemaketan pengadaan.',	'Mengetahui Supply Positioning Model.',	'b'),
(10,	'Komponen Rencana Anggaran Biaya (RAB) untuk pengadaan Barang terdiri dari :',	'Harga barang, ongkos angkut , PPn,  PPh',	'Harga Barang , Ogkos angkut, PPn',	'Harga Barang, ongkos angkut, PPh',	'Harga barang, ongkos angkut, biaya tak terduga, PPn',	'b'),
(11,	'Berikut ini bukan merupakan sumber informasi yang dapat diandalkan untuk mengetahui kondisi pasar :',	'Brosur Penyedia',	'Tagihan dari Penyedia',	'Internet',	'Perusahaan lain yang bergerak dalam bidang yang sejenis',	'b'),
(13,	'Untuk menganalis kemampuan penyedia dengan menggunakan data keuangan dengan menghitung rasio keuangan, salah satunya adalah menghitung rasio solvabilitas, apa tujuan menghitung rasio solvabilitas penyedia :',	'Menghitung apakah usaha penyedia mengalami keuntungan',	'Menghitung kemampuan penyedia dalam membayar kwajiban jangka pendek Penyedia dengan mengunakan aktiva lancer yang ada',	'Menghitung apakah penyedia mempunyai kemampuan untuk membayar semua kewajiban pada saat yang diperjanjikan.',	'Mengitung kemampuan Penyedia dalam membayar  gaji karyawannya.',	'c'),
(14,	'Proses awal Penentuan penyedia barang yang akan diikutsertakan dalam pengadaan barang  dan jasa disebut :',	'Kualifikasi',	'Akreditasi',	'Seleksi',	'Verifikasi',	'a'),
(15,	'Dalam  teori Supplier Perception Model (SPM), motivasi penyedia dibagi  menjadi 4 (empat) kuadran, salah satu kuadran adalah penyedia yang setengah hati melayani permintaan pembelinya karena volume/nilai pembelian yang sedikit, tipe suplier ini disebut :',	'Develop',	'Exploit',	'Marginal',	'Core',	'c'),
(16,	'Apakah akibatnya ketika dalam pengadaan barang dan jasa salah menentukan jenis dokumen pengadaannya :',	'Menimbulkan kebingungan dan ketidakpastian',	'Memunculkan potensi sanggah yang akan menghambat proses pengadaan',	'Hasil pengadaan  tidak sesuai dengan yang diharapkan.',	'Jawaban a, b dan c semua  benar',	'd'),
(17,	'Apabila Instruksi Kepada Penyedia telah menunjukkan kepatuhan terhadap pedoman pengadaan barang dan jasa  dan peraturan perundang-undangan terkait, hal tersebut telah memenuhi prinsip :',	'akuntabilitas',	'adil',	'kejujuran',	'eligibilitas',	'a'),
(18,	'Informasi atau bagian yang tidak tercakup dalam dokumen Pengadaan adalah :',	'Kebijakan untuk penerima manfaat',	'Instruksi, persyaratan dan pemberitahuan untuk penawar',	'Rancangan perjanjian (kontrak)',	'Kerangka Acuan Kerja',	'a'),
(19,	'Berikut ini manakah yang tidak harus dicantumkan dalam dokumen penetapan pemenang tender terbuka untuk Badan Usaha :',	'Nama dan alamat Penyedia',	'NPWP',	'Harga Penawaran terkoreksi setelah koreksi aritmatik.',	'Nama Pimpinan Perusahaan Penyedia',	'd'),
(20,	'Dalam penyusunan Dokumen Pengadaan, mana dokumen pendukung dibawah ini yang tidak diperlukan :',	'Spesifikasi teknis pekerjaan yang akan dilaksanakan.',	'Gambar-gambar pekerjaan konstruksi yang akan dilaksanakan.',	'Rincian HPS.',	'Daftar kuantitas dan harga.',	'c'),
(21,	'Proses yang dilakukan untuk memastikan personil diantara penyedia tidak memiliki keterkaitan hubungan kekerabatan yang dapat menyebabkan terjadi persaingan yang tidak sehat dalam pelaksanaan tender disebut...',	'Verifikasi',	'Validasi',	'Penilaian',	'Uji Interdependensi',	'd'),
(22,	'Berikut ini yang bukan merupakan unsur penilaian teknis untuk Jasa Konsultansi Badan Usaha adalah:',	'Ijin Usaha.',	'Kualifikasi Tenaga Ahli',	'Pengalaman Perusahaan',	'Metodologi pelaksanaan',	'a'),
(24,	'Proses yang dilakukan oleh Panitia Pemilihan untuk memastikan semua data atau dokumen yang disampaikan penyedia, baik diserahkan langsung, melalui email, atau diunggah sistem e-Procurement, telah memenuhi atau belum  atas semua persyaratan yang ditentukan oleh pembeli disebut :',	'Kualifikasi',	'Verifikasi',	'Validasi',	'Justifikasi',	'b'),
(25,	'Dibawah ini manakah yang bukan merupakah persyaratan kualifikasi administrasi :',	'Akte Pendirian Perusahaan',	'Surat Keterangan Keagenan',	'Surat Keterangan Pengusaha Kena Pajak (PKP)',	'Pengalaman Perusahaan',	'd'),
(27,	'Berikut ini yang bukan faktor-faktor yang mempengaruhi pemilihan metode pengadaan adalah :',	'Jenis Barang/jasa',	'Nilai',	'Kompleksitas Barang/Jasa',	'Kualifikasi penyedia',	'd'),
(28,	'Masa berlaku jaminan penawaran lebih pendek dengan  yang diperyaratkan di dalam dokumen pengadaan,  dengan kondisi tersebut maka :',	'Penawaran gugur',	'Diakukan klarifikasi dan peserta diminta untuk mengganti jaminan penawaran dan penawaran tidak digugurkan',	'Peserta tidak dgugurkan dengan membuat persyaratan apabila  ditunjuk sebagai pemenang harus mengganti surat penawaran.',	'Diabaikan.',	'a'),
(29,	'Dalam Pengadaan Barang dan Jasa yang berlaku umum di Indonesia (pengadaan pemerintah), dilarang menyebutkan merek tertentu karena hal ini dianggap melanggar prinsip :',	'Adil (tidak diskriminatif)',	'Terbuka',	'Bertanggungjawab',	'Transparan',	'a'),
(30,	'Dalam Pengadaan Barang, manakah pernyataan dibawah ini yang menggambarkan bahwa penawaran tersebut dinyatakan memenuhi persyaratan teknis:',	'Memenuhi bobot nilai yang ditentukan.',	'Memenuhi spesifikasi teknis Barang yang ditawarkan berdasarkan contoh, brosur atau gambar-gambar yang ditetapkan dalam Dokumen Pengadaan',	'Jangka waktu berlakunya surat penawaran tidak kurang dari waktu yang ditetapkan dalam Dokumen Pengadaan.',	'Surat Penawaran teknis ditandatangani oleh Pimpinan/Direksi.',	'b');
